std::string longestCommonPrefix(std::vector<std::string>& strs){
    int len = strs.size();
    std::string str = strs[0];
    for (int i = 1; i < len; ++i){
        for (int j = 0; j < str.length(); ++j){
            if(strs[i][j] != str[j]){
                str = str.substr(0, j);
            }
        }
        if(str.empty()){
            break;
        }
    }
    return str;
}